  const [data, setData] = useState();

  useEffect(() => {
    axios("https://fakestoreapi.com/products")
      .then((res) => setData(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <Section>
        <Column1>
          <Button>Get Api Data</Button>
        </Column1>
        <Column2> TAble content</Column2>
      </Section>
    </div>
  );
};

export default Body;
